//============================
// Main File Processing Methods
//=============================
function processSection(output,sectionName,sectionEntry) {
    if(!sectionEntry) return;

    var propType = null;
    var path = [];

    for(var ip = 0; ip < sectionEntry.length; ip++) {
        var priorityEntry = sectionEntry[ip];
        var priority = priorityEntry.priority;

        //get a default rule (should only be on lowest priority)
        var payload = getPayload(priorityEntry);
        if(payload) {
            var outEntry = createEntry(sectionName,priority,propType,path,payload);
            output.push(outEntry);
        }

        var keyList = priorityEntry.ks;
        processKeyList(output,sectionName,priority,propType,path,keyList);
    }
}

function processKeyList(output,section,priority,propType,parentPath,keyList) {
    for(var i = 0; i < keyList.length; i++) {
        var keyEntry = keyList[i];
        processKeyEntry(output,section,priority,propType,parentPath,keyEntry);
    }
}

function processKeyEntry(output,section,priority,propType,parentPath,keyEntry) {
    var newPropType;
    var keyValue;
    if(keyEntry.gk !== undefined) {
        newPropType = "geometry";
        keyValue = keyEntry.gk;
    }
    else if(keyEntry.ek !== undefined) {
        newPropType = "entity";
        keyValue = keyEntry.ek;
    }
    else if(keyEntry.ak !== undefined) {
        newPropType = "address";
        keyValue = keyEntry.ak;
    }

    if(!propType) {
        propType = newPropType;
    }
    else {
        if(propType != newPropType) {
            throw new Error("Prop type mismatch - not supported in current ingester");
        }
    }

    var path = addKeyToParentPath(parentPath,keyValue);

    //this does style and label
    var payload = getPayload(keyEntry);
    if(payload) {
        var outEntry = createEntry(section,priority,propType,path,payload);
        output.push(outEntry);
    }

    if(keyEntry.v) {
        processValueMap(output,section,priority,propType,path,keyEntry.v);
    }

}

function processValueMap(output,section,priority,propType,parentPath,valueSet) {
    for(var value in valueSet) {
        var valueEntry = valueSet[value];
        processValueEntry(output,section,priority,propType,parentPath,value,valueEntry);
    }
}

function processValueEntry(output,section,priority,propType,parentPath,value,valueEntry) {
    var path = addValueToParentPath(parentPath,value);

    //this does style and label
    var payload = getPayload(valueEntry);
    if(payload) {
        var outEntry = createEntry(section,priority,propType,path,payload);
        output.push(outEntry);
    }

    if(valueEntry.ks) {
        processKeyList(output,section,priority,propType,path,valueEntry.ks);
    }
}

//============================
// helpers
//=============================
function addKeyToParentPath(parentPath,keyValue) {
    //creates a new instance (does not modify parentPath)
    return parentPath.concat([[keyValue]]);
}

function addValueToParentPath(parentPath,value) {
    var pathCopy = apogeeutil.jsonCopy(parentPath);
    var lastKeyValue = pathCopy[pathCopy.length-1];
    if(lastKeyValue.length !== 1) {
        //sanity check
        throw new Error("expecting a path element with a key and no path");
    }
    lastKeyValue.push(value);
    return pathCopy;
}

function pathInfoToString(propType,path) {
    var accumulator = function(total,entry) {
        if(total.length > 0) {
            total += "; ";
        }
        return total + entry.join(":");
    }
    return propType + " " + path.reduce(accumulator,"");
}


//this gets the payload from a key or value entry from the style or label section
//returns the payload structure if there is a payload and null if not.
function getPayload(entry) {
